import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import TopHeader from './components/Navbar/TopHeader';
import Navbar from "./components/Navbar/Navbar";
import Home from './pages/Home/Home';
import Footer from "./components/Footer/footer";
import Produits from './pages/Produit/Produits';
import Commande from './pages/Commande/Commande';
import Register from "./pages/Register/Register";
import Login from "./pages/Login/Login";
import { AuthProvider } from './context/AuthContext';
import Dashboard from './pages/Dashboard/Dashboard';


function App() {
    return (
        <AuthProvider>
            <Router>
                <>
                    <TopHeader />
                    <Navbar />
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/produits" element={<Produits />} />
                        <Route path="/commandes" element={<Commande />} />
                        <Route path="/register" element={<Register />} />
                        <Route path="/login" element={<Login />} />

                        {/* Route dashboard avec sous-routes */}
                        <Route path="/dashboard" element={<Dashboard />}>
                            <Route path="utilisateurs" element={<div>Gestion utilisateurs</div>} />
                            <Route path="produits" element={<div>Gestion produits</div>} />
                            <Route path="commandes" element={<div>Gestion commandes</div>} />
                        </Route>
                    </Routes>
                    <Footer />
                </>
            </Router>
        </AuthProvider>
    );
}

export default App;
